const PhotoListDetail = ({ urls, description }) => {
	const classes = useStyles();
	const renderDetail = () => {
		return (
			<div>
				<img className={classes.image} src={urls} alt={description} loading="lazy" />
			</div>
		);
	};
/* TODO:  */
